Sun May 23, 2010
I went to the camp site today to do a little camping when I happened to bump into this lovely young lady named Manndy who was sitting all alone. So me being the nice guy that I am I offered her some company! After the mention of a few hundreds for her to come and hang out we were leaving the main site and going back by my tent. This is where all the action took place in front of my tent, Im glad no one walked up on us during that time or we would have been caught with our pants down literally! Enjoy!
